NOTICE: This map was made with the purpose of being used in the Gun Game gamemode for Counter-Strike: Source, if you do not have the mod installed or use it for another game, it may not work well.

A map that offers you quick, fun and easy rounds for both good and bad players.
Since the gg_kikwalls_v1_beta looked really bad, I decided to change it almost completely, leaving only the original layout covered with a much better one.
This map features:
  - A good and eye candy light environment;
  - 18 player slots;
  - Two ways out of spawn, in which one of them having a view over the whole map;
  - Dark spots where you can blend in for an easier knife kill;
  - Optimized for good FPS.
